function Square({ dark }) {
    let c = "chessSquare";
    c = dark ? c + ' dark' : c;
    return <div className={c}></div>
}

function Row() {
    let squares = [];

    for (let i = 0; i < 8; i++) {
        squares.push(<Square></Square>)
    }
}

export default function Chess() {
    return (<>
        <Square></Square>
        <Square dark={true}></Square>
        <Square></Square>
        <Square dark={true}></Square>
        <Square></Square>
        <Square dark={true}></Square>
        <Square></Square>
        <Square dark={true}></Square>
    </>)
}
